import React from "react";
import RenderActivities from "./RenderActivities"

export default function PrepTable({ activity, activityHash }) {
  console.log("inside PrepTable");
  const table = activityHash.map((a) => {
    return (
      <tr key={a.id}>
          <td></td>
        <td>{a.minutes}</td>
        <td>{a.notes}</td>
      </tr>
    );
  });

  return (
    <>
      <RenderActivities table={table} />
    </>
  );
}
